INSERT INTO `wp_posts` VALUES('3', '1', '2017-08-30 12:54:52', '2017-08-30 12:54:52', 'It seems like youâ€™re running a default WordPress website. Here are a few useful links to get you started:\n\n<h2><span style=\"color: #000000;\"><strong>Migration</strong></span></h2>\n<ul>\n        <li><a href=\"https://support.cloudways.com/how-to-migrate-wordpress-to-cloudways/?utm_source=WordPress&amp;Staging&amp;Sites&amp;utm_medium=WP&amp;Staging&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to use WordPress Migrator Plugin?</span></a></li>\n        <li><a href=\"https://support.cloudways.com/siteground-to-cloudways-wordpress-migration/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">Migrate WordPress from Siteground to Cloudways</span></a></li>\n        <li><a href=\"https://support.cloudways.com/godaddy-to-cloudways-wordpress-migration/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">Migrate WordPress from GoDaddy to Cloudways</span></a></li>\n</ul>\n\n<h2><span style=\"color: #000000;\"><strong>General</strong></span></h2>\n<ul>\n        <li><a href=\"https://support.cloudways.com/how-do-i-take-my-website-live-from-cloudways/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\"><span style=\"color: #0000ff;\">How do I take my website live from Cloudways?</span></span></a></li>\n        <li><a href=\"https://support.cloudways.com/how-to-manage-wordpress-with-wp-cli/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to manage WordPress via WP-CLI on Cloudways?</span></a></li>\n        <li><a href=\"https://support.cloudways.com/how-to-setup-a-wordpress-multisite-on-cloudways/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to configure WordPress Multisite on Cloudways?</span></a></li>\n        <li><a href=\"https://support.cloudways.com/mysql-database-access-options/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to access your databases on Cloudways?</span></a></li>\n</ul>\n\n<h2><span style=\"color: #000000;\"><strong>Performance</strong></span></h2>\n<ul>\n        <li><a href=\"https://support.cloudways.com/breeze-wordpress-cache-configuration/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to install and configure Breeze WordPress cache plugin?</span></a></li>\n        <li><a href=\"https://support.cloudways.com/wordpress-cloudways-cdn/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to integrate CloudwaysCDN with your WordPress website?</span></a></li>\n        <li><a href=\"https://support.cloudways.com/how-to-configure-wp-rocket-plugin-wordpress/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to configure WP Rocket plugin for WordPress?</span></a></li>\n</ul>\n\n<h2><span style=\"color: #000000;\"><strong>Security</strong></span></h2>\n<ul>\n        <li><a href=\"https://support.cloudways.com/what-can-i-do-with-an-htaccess-file/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">What can I do with an .htaccess file?</span></a></li>\n        <li><a href=\"https://www.cloudways.com/blog/add-free-ssl-certificate-to-wordpress-websites/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">Add free SSL certificate to WordPress websites</span></a></li>\n        <li><a href=\"https://support.cloudways.com/how-to-set-up-sucuri-antivirus-website-monitoring/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to setup Sucuri on WordPress websites at Cloudways?</span></a></li>\n</ul>\n\n<h2><span style=\"color: #000000;\"><strong>Email</strong></span></h2>\n<ul>\n        <li><a href=\"https://support.cloudways.com/emailing-with-cloudways/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">Which email add-on should I use?</span></a></li>\n        <li><a href=\"https://support.cloudways.com/how-to-activate-rackspace-email-addon/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to activate Rackspace email addon?</span></a></li>\n        <li><a href=\"https://support.cloudways.com/how-to-activate-elasticemail-addon/?utm_source=WordPress&amp;&amp;Sites&amp;utm_medium=WP&amp;&amp;utm_campaign=cloudways-wp\" target=\"_blank\" rel=\"noopener\"><span style=\"color: #0000ff;\">How to activate the Elastic email add-on?</span></a></li>\n</ul>', 'Some Useful Links for You to Get Started', '', 'publish', 'open', 'open', '', 'welcome-to-cloudways', '', '', '2017-08-30 12:54:52', '2017-08-30 12:54:52', '', '0', 'http://lms.engaging-people.com/?p=1', '0', 'post', '', '1');
INSERT INTO `wp_posts` VALUES('7', '2', '2019-01-15 11:31:18', '2019-01-15 11:31:18', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.', 'Course 1', '', 'publish', 'closed', 'closed', '', 'course-1', '', '', '2020-02-24 08:24:02', '2020-02-24 08:24:02', '', '0', 'https://lms.engaging-people.com/?post_type=lms_course&#038;p=7', '1', 'lms_course', '', '0');
