INSERT INTO `wp_posts` VALUES('4095', '12', '2020-07-28 13:23:57', '2020-07-28 13:23:57', '<!-- wp:paragraph -->\n<p>Assurance is provided by organization management, it means giving a positive declaration on a product which obtains confidence for the outcome. It gives a security that the product will work without any glitches as per the expectations or requests.</p>\n<!-- /wp:paragraph -->', 'What is Assurance?', '', 'publish', 'closed', 'closed', '', 'what-is-assurance', '', '', '2020-07-28 13:23:58', '2020-07-28 13:23:58', '', '0', 'https://lms.engaging-people.com/?post_type=tg_lesson&#038;p=4095', '0', 'tg_lesson', '', '0');
INSERT INTO `wp_posts` VALUES('4096', '12', '2020-07-28 13:23:57', '2020-07-28 13:23:57', '<!-- wp:paragraph -->\n<p>Assurance is provided by organization management, it means giving a positive declaration on a product which obtains confidence for the outcome. It gives a security that the product will work without any glitches as per the expectations or requests.</p>\n<!-- /wp:paragraph -->', 'What is Assurance?', '', 'inherit', 'closed', 'closed', '', '4095-revision-v1', '', '', '2020-07-28 13:23:57', '2020-07-28 13:23:57', '', '4095', 'https://lms.engaging-people.com/4095-revision-v1/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES('4097', '12', '2020-07-28 13:24:39', '2020-07-28 13:24:39', '<!-- wp:paragraph -->\n<p>Quality Assurance is known as QA and focuses on preventing defect. Quality Assurance ensures that the approaches, techniques, methods and processes are designed for the projects are implemented correctly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality assurance activities monitor and verify that the processes used to manage and create the deliverables have been followed and are operative.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality Assurance is a proactive process and is Prevention in nature. It recognizes flaws in the process. Quality Assurance has to complete before Quality Control.</p>\n<!-- /wp:paragraph -->', 'What is Quality Assurance?', '', 'publish', 'closed', 'closed', '', 'what-is-quality-assurance', '', '', '2020-08-12 12:49:36', '2020-08-12 12:49:36', '', '0', 'https://lms.engaging-people.com/?post_type=tg_lesson&#038;p=4097', '0', 'tg_lesson', '', '0');
INSERT INTO `wp_posts` VALUES('4098', '12', '2020-07-28 13:24:39', '2020-07-28 13:24:39', '<!-- wp:paragraph -->\n<p>Quality Assurance is known as QA and focuses on preventing defect. Quality Assurance ensures that the approaches, techniques, methods and processes are designed for the projects are implemented correctly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality assurance activities monitor and verify that the processes used to manage and create the deliverables have been followed and are operative.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality Assurance is a proactive process and is Prevention in nature. It recognizes flaws in the process. Quality Assurance has to complete before Quality Control.</p>\n<!-- /wp:paragraph -->', 'What is Quality Assurance?', '', 'inherit', 'closed', 'closed', '', '4097-revision-v1', '', '', '2020-07-28 13:24:39', '2020-07-28 13:24:39', '', '4097', 'https://lms.engaging-people.com/4097-revision-v1/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES('4099', '12', '2020-07-28 13:25:07', '2020-07-28 13:25:07', '<!-- wp:paragraph -->\n<p>Quality Control is known as QC and focuses on identifying a defect. QC ensures that the approaches, techniques, methods and processes are designed in the project are following correctly. QC activities monitor and verify that the project deliverables meet the defined quality standards.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality Control is a reactive process and is detection in nature. It recognizes the defects. Quality Control has to complete after Quality Assurance.</p>\n<!-- /wp:paragraph -->', 'What is Quality Control?', '', 'publish', 'closed', 'closed', '', 'what-is-quality-control', '', '', '2020-08-30 12:44:41', '2020-08-30 12:44:41', '', '0', 'https://lms.engaging-people.com/?post_type=tg_lesson&#038;p=4099', '0', 'tg_lesson', '', '0');
INSERT INTO `wp_posts` VALUES('4100', '12', '2020-07-28 13:25:07', '2020-07-28 13:25:07', '<!-- wp:paragraph -->\n<p>Quality Control is known as QC and focuses on identifying a defect. QC ensures that the approaches, techniques, methods and processes are designed in the project are following correctly. QC activities monitor and verify that the project deliverables meet the defined quality standards.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality Control is a reactive process and is detection in nature. It recognizes the defects. Quality Control has to complete after Quality Assurance.</p>\n<!-- /wp:paragraph -->', 'What is Quality Control?', '', 'inherit', 'closed', 'closed', '', '4099-revision-v1', '', '', '2020-07-28 13:25:07', '2020-07-28 13:25:07', '', '4099', 'https://lms.engaging-people.com/4099-revision-v1/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES('4101', '12', '2020-07-28 13:25:38', '2020-07-28 13:25:38', '<!-- wp:paragraph -->\n<p>Many people think QA and QC are the same and interchangeable but this is not true. Both are tightly linked and sometimes it is very difficult to identify the differences. Fact is both are related to each other but they are different in origins. QA and QC both are part of Quality Management however QA is focusing on preventing defect while QC is focusing on identifying the defect.</p>\n<!-- /wp:paragraph -->', 'What is The Difference in QA/QC?', '', 'publish', 'closed', 'closed', '', 'what-is-the-difference-in-qa-qc', '', '', '2020-08-30 12:42:13', '2020-08-30 12:42:13', '', '0', 'https://lms.engaging-people.com/?post_type=tg_lesson&#038;p=4101', '0', 'tg_lesson', '', '0');
INSERT INTO `wp_posts` VALUES('4102', '12', '2020-07-28 13:25:38', '2020-07-28 13:25:38', '<!-- wp:paragraph -->\n<p>Many people think QA and QC are the same and interchangeable but this is not true. Both are tightly linked and sometimes it is very difficult to identify the differences. Fact is both are related to each other but they are different in origins. QA and QC both are part of Quality Management however QA is focusing on preventing defect while QC is focusing on identifying the defect.</p>\n<!-- /wp:paragraph -->', 'What is The Difference in QA/QC?', '', 'inherit', 'closed', 'closed', '', '4101-revision-v1', '', '', '2020-07-28 13:25:38', '2020-07-28 13:25:38', '', '4101', 'https://lms.engaging-people.com/4101-revision-v1/', '0', 'revision', '', '0');
