INSERT INTO `wp_posts` VALUES('4146', '1', '2020-08-12 12:50:00', '2020-08-12 12:50:00', '<!-- wp:paragraph -->\n<p>Quality Assurance is known as QA and focuses on preventing defect. Quality Assurance ensures that the approaches, techniques, methods and processes are designed for the projects are implemented correctly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality assurance activities monitor and verify that the processes used to manage and create the deliverables have been followed and are operative.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality Assurance is a proactive process and is Prevention in nature. It recognizes flaws in the process. Quality Assurance has to complete before Quality Control.</p>\n<!-- /wp:paragraph -->', 'What is Quality Assurance?', '', 'inherit', 'closed', 'closed', '', '4097-autosave-v1', '', '', '2020-08-12 12:50:00', '2020-08-12 12:50:00', '', '4097', 'https://lms.engaging-people.com/4097-autosave-v1/', '0', 'revision', '', '0');
