INSERT INTO `wp_posts` VALUES('4177', '1', '2020-08-30 12:42:19', '2020-08-30 12:42:19', '<!-- wp:paragraph -->\n<p>Many people think QA and QC are the same and interchangeable but this is not true. Both are tightly linked and sometimes it is very difficult to identify the differences. Fact is both are related to each other but they are different in origins. QA and QC both are part of Quality Management however QA is focusing on preventing defect while QC is focusing on identifying the defect.</p>\n<!-- /wp:paragraph -->', 'What is The Difference in QA/QC?', '', 'inherit', 'closed', 'closed', '', '4101-autosave-v1', '', '', '2020-08-30 12:42:19', '2020-08-30 12:42:19', '', '4101', 'https://lms.engaging-people.com/4101-autosave-v1/', '0', 'revision', '', '0');
INSERT INTO `wp_posts` VALUES('4178', '1', '2020-08-30 12:44:43', '2020-08-30 12:44:43', '<!-- wp:paragraph -->\n<p>Quality Control is known as QC and focuses on identifying a defect. QC ensures that the approaches, techniques, methods and processes are designed in the project are following correctly. QC activities monitor and verify that the project deliverables meet the defined quality standards.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Quality Control is a reactive process and is detection in nature. It recognizes the defects. Quality Control has to complete after Quality Assurance.</p>\n<!-- /wp:paragraph -->', 'What is Quality Control?', '', 'inherit', 'closed', 'closed', '', '4099-autosave-v1', '', '', '2020-08-30 12:44:43', '2020-08-30 12:44:43', '', '4099', 'https://lms.engaging-people.com/4099-autosave-v1/', '0', 'revision', '', '0');
